/* eslint-disable prettier/prettier */
import styled from 'styled-components';
import {FiHeart} from 'react-icons/fi';

const TrackSide = () => (
        <Wrapper>
            <Heading>
                Top Tracks
            </Heading>
            <TopBar>
                <ListItems>
                    <h3>Sheikh Jafar</h3>
                    <p>Mata Muminai</p>
                    <h3>10k</h3>
                    <FiHeart color="#309f5e" size={18}/>
                </ListItems>
                <ListItems>
                    <h3>Sheikh Mansoor</h3>
                    <p>Ruhul Adab</p>
                    <h3>12k</h3>
                    <FiHeart color="#309f5e" size={18}/>
                </ListItems>
                <ListItems>
                    <h3>Sheikh Maqari</h3>
                    <p>Gaskiyar Magana</p>
                    <h3>15k</h3>
                    <FiHeart color="#309f5e" size={18}/>
                </ListItems>
                <ListItems>
                    <h3>Sheikh Ameen</h3>
                    <p>Imani</p>
                    <h3>22k</h3>
                    <FiHeart color="#309f5e" size={18}/>
                </ListItems>
            </TopBar>
        </Wrapper>
    )
const Wrapper = styled.div`
padding-top:24px;
`
const Heading = styled.h2`
color:hsl(0, 0%, 39%);
font-size:24px;
font-weight:bold;

`
const ListItems = styled.li`
list-style:none;
display:flex;
justify-content:space-between;
margin-bottom:24px;
p{
    color:hsl(0,0%,49%);
}
h3{
    color:hsl(0,0%,45%);
}
`
const TopBar = styled.ol`
padding-right:30px;

`
export default TrackSide;
